Lo nuevo de Puertos. Orillas es el nombre del último barrio que acaba de lanzar la gran ciudad de Escobar. Se trata de 438 lotes en una zona que se ubica frente al gran lago central y que también está muy cerca de la Reserva. Los terrenos van desde los 600 a los 1540 m2, de los cuales la mitad ya fueron reservados.

